    private OrtEnvironment ortEnvironment = OrtEnvironment.getEnvironment();
    private void inference() {
        int modelIndex = 0;
        for (String line : inputList) {
            int model = getResourceModel(modelIndex);
            modelIndex++;
            try {
                String[] floatArr = line.split(",");
                float[][] input = new float[1][floatArr.length];
                for (int i = 0; i < floatArr.length; i++) {
                    float f = Float.parseFloat(floatArr[i].substring(0, floatArr[i].length() - 1));
                    input[0][i] = f;
                }
                byte[] is = toByteArray(getResources().openRawResource(model));
                ORTAnalyzer analyzer = new ORTAnalyzer(ortEnvironment, ortEnvironment.createSession(is));
                int result = analyzer.analyze(input);
            } catch (Exception e) {
                e.printStackTrace();
            } catch (Throwable throwable) {
                throwable.printStackTrace();
            }
        }
    }

   public int analyze(float[][] input) {
        try {
            int modelInputLen = 0;
            if (ortEnv == null || ortSession == null) {
                return -1;
            }
            Map<String, NodeInfo> inputInfoList = ortSession.getInputInfo();
            for(String s: inputInfoList.keySet()) {
                NodeInfo info = inputInfoList.get(s);
                if (info.getInfo() instanceof TensorInfo) {
                    int len = ((TensorInfo) info.getInfo()).getShape().length;
                    modelInputLen = (int) ((TensorInfo) info.getInfo()).getShape()[len - 1];
                }
            }
            if (input[input.length - 1].length != modelInputLen) {
                Log.d(TAG, "inference input size is not equal model input size");
                return -1;
            }
            Map<String, OnnxTensor> inputMap = new HashMap<>();
            OnnxTensor a = OnnxTensor.createTensor(ortEnv, input);
            inputMap.put("float_input", a);
            OrtSession.Result r = ortSession.run(inputMap);
            long[] labels = (long[])r.get(0).getValue();
            return (int)labels[0];
        }catch(Exception e){
            e.printStackTrace();
        }
        return -1;
    }

